import React, {Component} from 'react';
import LoginComponent from './LoginComponent.js';
import {
        Container,
        Row,
        Col,
        Button
       } from 'react-bootstrap';

class ProfileContent extends Component {
  render(){
    return (
      <Button variant="primary"
              onClick={()=>{sessionStorage.setItem('isLoggedOn', "False")}}>
        Log Out
      </Button>
    )
  }
}


class ProfilePage extends Component {
  render(){

    let is_logged_in = sessionStorage.getItem('isLoggedOn');
    let ret_component;

    if(is_logged_in == "True"){
      ret_component = <ProfileContent />;
    }else{
      ret_component = <LoginComponent />;
    }

    return (
        <Container>
          <Row>
            <Col xs={12}>
              {ret_component}
            </Col>
          </Row>
        </Container>
    )
  }
}

export default ProfilePage;
